import React from 'react'
import { SliderData } from './sliderData'

const ImageSlider = () => {
  return (
    <div>
        {SliderData.map((slide, index)=> {
        return(
        
        <video  muted AutoPlay loop src={slide.video}></video>
        )
    })}
    </div>
  )
}

export default ImageSlider
